import React, { 
  Component, 
  Fragment 
} 
from 'react';

import {
  Column,
  Grid,
  Row
} 
from "./components/bootstrap/grid";

class App extends Component {
  render() {
    return (
      <Fragment>
        <Grid>
          <Row>
            <Column>
              <h1 className="text center"> abra </h1>
            </Column>
            <Column className="text center text-danger">
              <h1> ibra </h1>
            </Column>
          </Row>
        </Grid>
      </Fragment>
    );
  }
}

export default App;
